import React, { useEffect, useState } from 'react';
import './styles/HomePage.css';
import ProfilePhoto from '../assets/ProfilePhoto.png';
import PBBIcon from '../assets/PBB.png';
import ListrikIcon from '../assets/Listrik.png';
import PulsaIcon from '../assets/Pulsa.png';
import PDAMIcon from '../assets/PDAM.png';
import PGNIcon from '../assets/PGN.png';
import TelevisiIcon from '../assets/Televisi.png';
import MusikIcon from '../assets/Musik.png';
import VoucherGameIcon from '../assets/Game.png';


const HomePage = () => {
  const [userData, setUserData] = useState(null);

  useEffect(() => {
    // Simulate fetching user data (Replace with your actual API call)
    const simulatedUserData = {
      name: 'Kristanto Wibowo',
      saldo: 'Rp ********',
    };
    setUserData(simulatedUserData);
  }, []);

  if (!userData) {
    return <div>Loading...</div>;
  }

  const services = [
    { name: 'PBB', icon: <img src={PBBIcon} alt="PBB Icon" className="service-icon" /> },
    { name: 'Listrik', icon: <img src={ListrikIcon} alt="Listrik Icon" className="service-icon" /> },
    { name: 'Pulsa', icon: <img src={PulsaIcon} alt="Pulsa Icon" className="service-icon" /> },
    { name: 'PDAM', icon: <img src={PDAMIcon} alt="PDAM Icon" className="service-icon" /> },
    { name: 'PGN', icon: <img src={PGNIcon} alt="PGN Icon" className="service-icon" /> },
    { name: 'Televisi', icon: <img src={TelevisiIcon} alt="Televisi Icon" className="service-icon" /> },
    { name: 'Musik', icon: <img src={MusikIcon} alt="Musik Icon" className="service-icon" /> },
    { name: 'Musik', icon: <img src={VoucherGameIconIcon} alt="VoucherGame Icon" className="service-icon" /> },
    { name: 'Voucher Makanan', icon: 'üçî' },
    { name: 'Qurban', icon: 'üêë' },
    { name: 'Zakat', icon: 'ü§≤' },
    { name: 'Paket Data', icon: 'üì∂' },
  ];

  const promotions = [
    { title: 'Saldo Gratis!', description: 'Saldo gratis Rp25.000 untuk pengguna pertama', image: '/path/to/promo1.jpg' },
    { title: 'Diskon listrik!', description: 'Diskon untuk pembayaran listrik prabayar/pascabayar 10%', image: '/path/to/promo2.jpg' },
    { title: 'Promo makan!', description: 'Dapatkan voucher makanan setiap transaksi', image: '/path/to/promo3.jpg' },
    { title: 'Cashback 25%', description: 'Cashback untuk setiap pembayaran di atas Rp100.000', image: '/path/to/promo4.jpg' },
    { title: 'Buy 1 Get 2!', description: 'Promosi untuk pembelian paket data tertentu', image: '/path/to/promo5.jpg' },
  ];

  return (
    <div className="homepage">
      <header>
        <h1>SIMS PPOB</h1>
        <nav>
          <ul>
            <li>Top Up</li>
            <li>Transaction</li>
            <li>Akun</li>
          </ul>
        </nav>
      </header>

      <main>
        <section className="user-info">
          <img src={ProfilePhoto} alt="User Avatar" className="avatar" />
          <p>Selamat datang, {userData.name}</p>
        </section>

        <section className="saldo">
          <div className="saldo-container">
            <p>Saldo Anda</p>
            <p className="saldo-amount">{userData.saldo}</p>
            <button>Lihat Saldo</button>
          </div>
        </section>

        <section className="services">
        {services.map((service, index) => (
        <div key={index} className="service-item">
        <span>{service.icon}</span>
        <p>{service.name}</p>
       </div>
        ))}
        </section>


        <section className="promotions">
          {promotions.map((promo, index) => (
            <div key={index} className="promo-item">
              <img src={promo.image} alt={promo.title} />
              <h3>{promo.title}</h3>
              <p>{promo.description}</p>
            </div>
          ))}
        </section>
      </main>

      <footer>
        {/* Footer content here */}
      </footer>
    </div>
  );
};

export default HomePage;
